function dsOutRacer_OnLoadCompleted(obj,nErrorCode,strErrorMsg,nReason)
{	
	var nRow = dsOutRacer.GetRowCount();
	var sRacer;
	var sRank;
	var sRACE_REG_NO;

	if (nRow <= 0) return;
	for (var i = 0; i < nRow; i++)
	{
		sRACE_REG_NO = dsOutRacer.GetColumn(i, "RACE_REG_NO");
		sRank		 = dsOutRacer.GetColumn(i, "RANK");
		sRacer += sRACE_REG_NO + "-" + dsOutRacer.GetColumn(i, "NM_KOR");

		if (sRank != "")
			sRacer += "(" + sRank + "착)";

		if (i < nRow - 1)
			sRacer += ", ";
	}
	stRacer.Text = "출전선수 : " + sRacer;
	fcSearchDivRate();
}

function dsOutDivRate_OnColumnChanged(obj,nRow,strColumnID,varOldValue,varNewValue,nPivotIndex)
{
	//승식
	var sPoolCd;
	//조건식
	var sSearch;
	//조건식에 맞는 Record Index
	var nSearchRow;
	//추가된 Record Index
	var nAddRow;
	var sRUNNER_1ST;
	var sRUNNER_2ND;
	var sRUNNER_3RD;

	nSearchRow = dsOutDivMap.SearchRow("DATASET_ID = '" + obj.ID + "' &&GRID_ROW = " + nRow + " && COL_VALUE = '" + strColumnID + "'");

	sPoolCd		= dsOutDivMap.GetColumn(nSearchRow, "POOL_CD");
	sRUNNER_1ST	= dsOutDivMap.GetColumn(nSearchRow, "RUNNER_1ST");
	sRUNNER_2ND	= dsOutDivMap.GetColumn(nSearchRow, "RUNNER_2ND");
	sRUNNER_3RD	= dsOutDivMap.GetColumn(nSearchRow, "RUNNER_3RD");

	sSearch =	"POOL_CD = '" + sPoolCd + "' && RUNNER_1ST = '" + sRUNNER_1ST + "' && ";
	sSearch += 	"RUNNER_2ND = '" + sRUNNER_2ND + "' && RUNNER_3RD = '" + sRUNNER_3RD + "'";

	nSearchRow = dsOutDivRate.SearchRow(sSearch);
	if (nSearchRow == -1)
	{
		nAddRow = dsOutDivRate.AddRow();
		dsOutDivRate.SetColumn(nAddRow,	"MEET_CD", 		"003");
		dsOutDivRate.SetColumn(nAddRow, "STND_YEAR", 	dsOutRacer.GetColumn(0, "STND_YEAR"));
		dsOutDivRate.SetColumn(nAddRow, "TMS", 			dsOutRacer.GetColumn(0, "TMS"));
		dsOutDivRate.SetColumn(nAddRow, "DAY_ORD", 		dsOutRacer.GetColumn(0, "DAY_ORD"));
		dsOutDivRate.SetColumn(nAddRow, "RACE_NO", 		dsOutRacer.GetColumn(0, "RACE_NO"));
		dsOutDivRate.SetColumn(nAddRow, "POOL_CD", 		sPoolCd);
		dsOutDivRate.SetColumn(nAddRow, "RUNNER_1ST", 	sRUNNER_1ST);
		dsOutDivRate.SetColumn(nAddRow, "RUNNER_2ND", 	sRUNNER_2ND);
		dsOutDivRate.SetColumn(nAddRow, "RUNNER_3RD", 	sRUNNER_3RD);
		dsOutDivRate.SetColumn(nAddRow, "ODDS", 		varNewValue);
	}
	else
	{
		dsOutDivRate.SetColumn(nSearchRow, "ODDS", 		varNewValue);
	}
}

function btnSaveFile_OnClick(obj)
{
    if ( fnc_IsNull(edSdlFilePath.Text) ) return;
    var sTemp = Replace(edSdlFilePath.Text,"\\","/");
    var asFile = split(sTemp, "/");

    var rtn_arr = fnc_FileWrite(divBtnLst.HttpFile, edSdlFilePath.Text, asFile[asFile.length - 1], 'SDL');

    if ( rtn_arr[0] != "SUCC" ) {
        alert("파일 업로드 에러발생");
        return;
    }

    var sTemp = Replace(rtn_arr[1],"\\","/");
    var asFile = split(sTemp, "/");

	var sServiceName = "e01010120-service:saveSdlFile";
    var sInDataSet   = "";
    var sOutDataSet  = "";

	fce_AddParam("STND_YEAR", cboStndYear.Value);
    fce_AddParam("MBR_CD"   , cboMbrCd.Value   );
    fce_AddParam("TMS"      , cboTMS.Value     );
    fce_AddParam("DAY_ORD"  , cboDayOrd.Value  );
    fce_AddParam("RACE_NO"  , cboRACE_NO.Value );
    fce_AddParam("SDL_FILE" , rtn_arr[1]       );

    fce_AddParam("RACE_ALL" , chkAll.Value     );
    fce_AddParam("DT"       , chkDT .Value     );
    fce_AddParam("FN"       , chkFN .Value     );
    fce_AddParam("PB"       , chkPB .Value     );
    fce_AddParam("PT"       , chkPT .Value     );
    fce_AddParam("RS"       , chkRS .Value     );
    fce_AddParam("TM"       , chkTM .Value     );
    fce_AddParam("TR"       , chkTR .Value     );

	fce_SendTransaction(sServiceName, sInDataSet, sOutDataSet, "fcCallBack");
}


/*-------------------------------------------------------------------------------------------------+
>>  경주별 최고정번수에 따른 그리드 사이즈 조절
+-------------------------------------------------------------------------------------------------*/
function setGridSize(){
	/*
		IWORK_SFR-008 경정 선수편성 메뉴 개선  정번8 까지 추가 수정.
		회차에 따른 최고(8까지)정번수 별로 1 ~ 정번수 까지 화면에 표시.
	*/
	var nMaxTmsRunCnt = 8;
	var nMaxRaceRegNoCnt = -1;

	nMaxRaceRegNoCnt = dsOutSRace.GetColumn(cboRACE_NO.Index, "RACE_REG_NO_CNT");

	if(nMaxRaceRegNoCnt == -1 || fnc_IsNull(nMaxRaceRegNoCnt)) nMaxRaceRegNoCnt = 6;

	//Alert("nMaxRaceRegNoCnt : " + nMaxRaceRegNoCnt);

	grdPageList_004.Redraw = false;

	//전체적으로 사이즈를 넓힘.
	for ( var i = 0; i < nMaxTmsRunCnt; i++ ) {
        grdPageList_004.SetColProp(1 + i, "Width", 100);
    }

    //nMaxTmsRunCnt 부터 nMaxRaceRegNoCnt까지 사이즈를 줄임.
    for ( var i = nMaxTmsRunCnt; i > nMaxRaceRegNoCnt; i-- ) {
        grdPageList_004.SetColProp(1 + i-1, "Width", 0);
    }

    grdPageList_004.SetColProp(0, "Width", 100);

    grdPageList_004.Redraw = true;

    setLocation(nMaxRaceRegNoCnt);
}


/*-------------------------------------------------------------------------------------------------+
>>  경주별 최고정번수에 따른 그리드 사이즈 조절
+-------------------------------------------------------------------------------------------------*/
function setGridSize2(){
	/*
		IWORK_SFR-008 경정 선수편성 메뉴 개선  정번8 까지 추가 수정.
		회차에 따른 최고(8까지)정번수 별로 1 ~ 정번수 까지 화면에 표시.
	*/
	var nMaxTmsRunCnt = 8;
	var nMaxRaceRegNoCnt = -1;

	nMaxRaceRegNoCnt = dsOutSRace.GetColumn(cboRACE_NO.Index, "RACE_REG_NO_CNT");

	if(nMaxRaceRegNoCnt == -1 || fnc_IsNull(nMaxRaceRegNoCnt)) nMaxRaceRegNoCnt = 6;

	//Alert("nMaxRaceRegNoCnt : " + nMaxRaceRegNoCnt);

	Grid2.Redraw = false;

	//전체적으로 사이즈를 넓힘.
	for ( var i = 0; i < nMaxTmsRunCnt; i++ ) {
        Grid2.SetColProp(1 + i, "Width", 100);
    }

    //nMaxTmsRunCnt 부터 nMaxRaceRegNoCnt까지 사이즈를 줄임.
    for ( var i = nMaxTmsRunCnt; i > nMaxRaceRegNoCnt; i-- ) {
        Grid2.SetColProp(1 + i-1, "Width", 0);
    }

    Grid2.SetColProp(0, "Width", 100);

    Grid2.Redraw = true;
}


/*-------------------------------------------------------------------------------------------------+
>>  최고정번수에 따른 그리드 사이즈 조절
+-------------------------------------------------------------------------------------------------*/
function setLocation(nMaxRaceRegNoCnt){
	var oriBottom = grdPageList.Bottom;
	var extHeight = 0;
	var rowHeight = 19;
	var rowCnt = nMaxRaceRegNoCnt;
	var gap = 4;

	if(rowCnt < 6) rowCnt = 6;

	grdPageList.Height = (rowCnt + 2) * rowHeight - 2;
	grdPageList_004.Height = grdPageList.Height;

	Grid0.Height = grdPageList.Height;
	Grid2.Height = grdPageList.Height;

	Grid0.Top = grdPageList.Bottom + gap;
	Grid2.Top = grdPageList.Bottom + gap;

	Grid3.Top = Grid0.Bottom + gap;

	chkAll.Top = Grid3.Bottom + gap;
	chkDT.Top = Grid3.Bottom + gap;
	chkFN.Top = Grid3.Bottom + gap;
	chkPB.Top = Grid3.Bottom + gap;
	chkPT.Top = Grid3.Bottom + gap;
	chkRS.Top = Grid3.Bottom + gap;
	chkTM.Top = Grid3.Bottom + gap;
	chkTR.Top = Grid3.Bottom + gap;

	Static16.Top = chkAll.Bottom + gap;
	edSdlFilePath.Top = chkAll.Bottom + gap;
	imgFindFile.Top = chkAll.Bottom + gap;
	btnSaveFile.Top = chkAll.Bottom + gap;

	setGrid3Size(GetDeviceInfo("CYScreen") - 878);
}


/*-------------------------------------------------------------------------------------------------+
>>  최고정번수에 따른 DsOutDivMap(매핑 데이터셋 변경).
+-------------------------------------------------------------------------------------------------*/
function setDsOutDivMap(){
	var maxRegNoCnt = dsOutSRace.GetColumn(cboRACE_NO.Index, "RACE_REG_NO_CNT");

	if(maxRegNoCnt == 7){
		dsOutDivMap.DeleteAll();
		dsOutDivMap.Copy("dsOutDivMap_7");
	}else if(maxRegNoCnt == 8){
		dsOutDivMap.DeleteAll();
		dsOutDivMap.Copy("dsOutDivMap_8");
	}else{
		dsOutDivMap.DeleteAll();
		dsOutDivMap.Copy("dsOutDivMap_6"); // default..
	}

}

//common::comContents에서도 호출.
//삼복승식 그리드 높이 조절.(7, 8경주 인경우)
function setGrid3Size(height){

//Trace(" 승식별 배당률 입력 삼복승 추가 height : " + height);

	var rowHeight = 19;
	var gridHeight = 7 * rowHeight - 2;
	var gap = 4;

	if(dsOutSRace.GetColumn(cboRACE_NO.Index, "RACE_REG_NO_CNT") > 6){		

		if(gridHeight + height > 300){
			Grid3.Height = 300;
		}else{
			Grid3.Height = gridHeight + height;
		}

	}else{
		Grid3.Height = gridHeight;
	}

	chkAll.Top = Grid3.Bottom + gap;
	chkDT.Top = Grid3.Bottom + gap;
	chkFN.Top = Grid3.Bottom + gap;
	chkPB.Top = Grid3.Bottom + gap;
	chkPT.Top = Grid3.Bottom + gap;
	chkRS.Top = Grid3.Bottom + gap;
	chkTM.Top = Grid3.Bottom + gap;
	chkTR.Top = Grid3.Bottom + gap;

	Static16.Top = chkAll.Bottom + gap;
	edSdlFilePath.Top = chkAll.Bottom + gap;
	imgFindFile.Top = chkAll.Bottom + gap;
	btnSaveFile.Top = chkAll.Bottom + gap;
}
